DROP TABLE IF EXISTS `payment_transactions`;
CREATE TABLE `payment_transactions` (
  `id` double NOT NULL AUTO_INCREMENT,
  `userId` double NOT NULL,
  `txnId` varchar(255) NOT NULL,
